define('text!ng-admin/Crud/list/DatagridPagination.html',[],function () { return '<div ng-if="paginationCtrl.displayPagination">\r\n    <div class="grid-detail">\r\n        <span class="total">\r\n            <strong>{{ paginationCtrl.offsetBegin }}</strong> - <strong>{{ paginationCtrl.offsetEnd }}</strong> on <strong>{{ paginationCtrl.totalItems }}</strong>\r\n        </span>\r\n        <div class="btn-group btn-group-sm" role="group" aria-label="pagination">\r\n            <a href class="btn btn-default" ng-if="paginationCtrl.currentPage != 1" ng-click="paginationCtrl.setPage(paginationCtrl.currentPage - 1)">« Prev</a>\r\n            <a href class="btn btn-default" ng-if="paginationCtrl.nbPages > 1" ng-repeat="n in paginationCtrl.range(1, paginationCtrl.nbPages)" ng-class="{\'active\': n == paginationCtrl.currentPage}" ng-click="paginationCtrl.setPage(n)">{{ n }}</a>\r\n            <a href class="btn btn-default" ng-if="paginationCtrl.currentPage != paginationCtrl.nbPages" ng-click="paginationCtrl.setPage(paginationCtrl.currentPage + 1)">Next »</a>\r\n        </div>\r\n    </div>\r\n</div>\r\n';});

/*global define*/

define('ng-admin/Crud/list/DatagridPaginationController',[],function () {
    

    function DatagridPaginationController($scope, $location, $anchorScroll) {
        this.$scope = $scope;
        this.$location = $location;
        this.$anchorScroll = $anchorScroll;
    }

    DatagridPaginationController.prototype.computePagination = function () {
        var perPage = this.$scope.perPage,
            currentPage = this.$location.search().page || 1,
            totalItems = this.$scope.totalItems;

        this.displayPagination = this.$scope.hasPagination && !this.$scope.infinite;
        this.currentPage = currentPage;
        this.offsetEnd = Math.min(currentPage * perPage, totalItems);
        this.offsetBegin = Math.min((currentPage - 1) * perPage + 1, this.offsetEnd);

        this.totalItems = totalItems;

        this.nbPages = Math.ceil(totalItems / (perPage || 1)) || 1;
    };

    /**
     * Return an array with the range between min & max, useful for pagination
     *
     * @param {int} min
     * @param {int} max
     * @returns {Array}
     */
    DatagridPaginationController.prototype.range = function (min, max) {
        var input = [],
            i;

        for (i = min; i <= max; i++) {
            input.push(i);
        }

        return input;
    };

    DatagridPaginationController.prototype.nextPage = function () {
        if (!this.$scope.infinite || this.currentPage === this.nbPages) {
            return;
        }

        var searchParams = this.$location.search(),
            sortField = 'sortField' in searchParams ? searchParams.sortField : '',
            sortDir = 'sortDir' in searchParams ? searchParams.sortDir : '';

        this.currentPage++;

        this.$scope.nextPage(this.currentPage, sortField, sortDir);
    };

    /**
     * Link to page number of the list
     *
     * @param {int} number
     */
    DatagridPaginationController.prototype.setPage = function (number) {
        if (number <= 0 || number > this.nbPages) {
            return;
        }

        this.$location.search('page', number);
        this.$anchorScroll(0);
    };

    DatagridPaginationController.$inject = ['$scope', '$location', '$anchorScroll'];

    return DatagridPaginationController;
});

/*global define*/

define('ng-admin/Crud/list/maDatagridPagination',['require','angular','text!./DatagridPagination.html','./DatagridPaginationController'],function (require) {
    

    var angular = require('angular'),
        paginationView = require('text!./DatagridPagination.html'),
        DatagridPaginationController = require('./DatagridPaginationController');

    function DatagridPaginationDirective($window, $document) {
        return {
            restrict: 'E',
            scope: {
                perPage: '=',
                nextPage: '=',
                totalItems: '@',
                infinite: '='
            },
            template: paginationView,
            controllerAs: 'paginationCtrl',
            controller: DatagridPaginationController,
            link: function (scope, element, attrs, controller) {
                var offset = attrs.offset || 100,
                    body = $document[0].body;

                scope.hasPagination = !element.parent()[0].hasAttribute('with-pagination') ? true : scope.$eval(element.parent()[0].getAttribute('with-pagination'));
                if (scope.hasPagination) {
                    controller.computePagination();
                }

                if (scope.infinite) {
                    var handler = function () {
                        if (body.offsetHeight - $window.innerHeight - $window.scrollY < offset) {
                            scope.$apply(controller.nextPage.bind(controller));
                        }
                    };
                    var windowElement = angular.element($window);
                    windowElement.bind('scroll', handler);
                    element.on('$destroy', function() {
                        windowElement.unbind('scroll', handler);
                    });
                }
            }
        };
    }

    DatagridPaginationDirective.$inject = ['$window', '$document'];

    return DatagridPaginationDirective;
});


