/*global define*/

define('ng-admin/Crud/misc/ViewActions',['require','text!./view-actions.html'],function (require) {
    

    var viewActionsTemplate = require('text!./view-actions.html');

    function ViewActionsDirective($injector) {
        var $compile = $injector.get('$compile');

        return {
            restrict: 'E',
            transclude: true,
            scope: {
                'override': '&',
                'entry': '=',
                'entity': '='
            },
            template: viewActionsTemplate,
            link: function($scope, element, attrs, controller, transcludeFn) {
                var override = $scope.override();
                if (!override) {
                    // use the default tag content
                    transcludeFn($scope, function(clone) {
                        element.append(clone);
                    });
                    return;
                }
                if (typeof override == 'string') {
                    // custom template, use it instead of default template
                    element.html(override);
                    $compile(element.contents())($scope);
                    return;
                }
                // list of buttons - default template
                $scope.buttons = override;
            }
        };
    }

    ViewActionsDirective.$inject = ['$injector'];

    return ViewActionsDirective;
});

/*global define*/
// @see https://docs.angularjs.org/api/ng/service/$compile

define('ng-admin/Crud/misc/Compile',[],function () {
    

    function Compile($injector) {
        var $compile = $injector.get('$compile');

        return {
            transclude: true,
            link: function (scope, element, attrs, controller, transcludeFn) {
                scope.$watch(
                    function (scope) {
                        // watch the 'compile' expression for changes
                        return scope.$eval(attrs.compile);
                    },
                    function (value) {
                        if (false === value) {
                            // use the default tag content
                            transcludeFn(scope, function(clone) {
                                element.append(clone);
                            });
                            return;
                        }
                        // when the 'compile' expression changes assign it into the current DOM
                        element.html(value);

                        // compile the new DOM and link it to the current scope.
                        $compile(element.contents())(scope);
                    }
                );
            }
        };
    }

    Compile.$inject = ['$injector'];

    return Compile;
});


define('text!ng-admin/Crud/form/edit-attribute.html',[],function () { return '<div id="row-{{ field.name() }}" class="has-feedback" ng-class="formController.getValidationClassForField({{ formController.name }}.{{ field.name() }})">\r\n    <label for="{{ field.name() }}" class="col-sm-2 control-label">\r\n        {{ field.label() }}<span ng-if="field.validation().required">&nbsp;*</span>&nbsp;\r\n    </label>\r\n\r\n    <div ng-if="field.editable()" ng-class="field.getCssClasses(entry)||\'col-sm-10 col-md-8 col-lg-7\'" ng-switch="field.type()">\r\n        <ma-input-field ng-switch-when="string" field="::field" value="entry.values[field.name()]"></ma-input-field>\r\n\r\n        <ma-input-field ng-switch-when="password" type="password" field="::field" value="entry.values[field.name()]"></ma-input-field>\r\n\r\n        <ma-input-field ng-switch-when="email" type="email" field="::field" value="entry.values[field.name()]"></ma-input-field>\r\n\r\n        <ma-checkbox-field ng-switch-when="boolean" field="::field" value="entry.values[field.name()]"></ma-checkbox-field>\r\n\r\n        <ma-input-field ng-switch-when="number" type="number" field="::field" value="entry.values[field.name()]"></ma-input-field>\r\n\r\n        <ma-text-field ng-switch-when="text" field="::field" value="entry.values[field.name()]"></ma-text-field>\r\n\r\n        <div class="row" ng-switch-when="date"><ma-date-field field="::field" value="entry.values[field.name()]" class="col-sm-4"></ma-date-field></div>\r\n\r\n        <ma-choice-field ng-switch-when="choice" field="::field" value="entry.values[field.name()]"></ma-choice-field>\r\n\r\n        <ma-choice-field ng-switch-when="Reference" field="::field" value="entry.values[field.name()]"></ma-choice-field>\r\n\r\n        <ma-choices-field ng-switch-when="choices" field="::field" value="entry.values[field.name()]"></ma-choices-field>\r\n\r\n        <ma-choices-field ng-switch-when="ReferenceMany" field="::field" value="entry.values[field.name()]"></ma-choices-field>\r\n\r\n        <ma-datagrid ng-switch-when="ReferencedList"\r\n                  name="{{ field.getReferencedView().name() }}"\r\n                  entries="field.entries"\r\n                  fields="field.getReferencedView().fields()"\r\n                  entity="field.getReferencedView().entity"\r\n                  per-page="field.getReferencedView().perPage()"\r\n                  listActions="[]"\r\n                  infinite-pagination="false"\r\n                  with-pagination="false">\r\n        </ma-datagrid>\r\n\r\n        <ma-wysiwyg-field ng-switch-when="wysiwyg" field="::field" value="entry.values[field.name()]"></ma-wysiwyg-field>\r\n\r\n        <template-field ng-switch-when="template"></template-field>\r\n\r\n        <span ng-if="view.showAttributeSuccess()" class="glyphicon glyphicon-ok form-control-feedback" ng-show="true === {{ formController.name }}.{{ field.name() }}.$valid"></span>\r\n\r\n        <span ng-if="!view.showAttributeSuccess()" class="glyphicon glyphicon-remove form-control-feedback" ng-show="false === {{ formController.name }}.{{ field.name() }}.$valid"></span>\r\n    </div>\r\n\r\n    <div ng-if="!field.editable()" ng-class="field.getCssClasses(entry)||\'col-sm-10\'">\r\n        <p class="form-control-static">{{ entry.values[field.name()] }}</p>\r\n    </div>\r\n</div>\r\n';});

