define('text!ng-admin/Crud/show/show.html',[],function () { return '<div class="row">\r\n\r\n    <ma-view-actions override="showController.actions" entry="entry" entity="showController.entity">\r\n        <ma-list-button entity="entity"></ma-list-button>\r\n        <ma-edit-button ng-if="!entity.isReadOnly" entry="entry" entity="entity"></ma-edit-button>\r\n        <ma-delete-button ng-if="!entity.isReadOnly" entry="entry" entity="entity"></ma-delete-button>\r\n    </ma-view-actions>\r\n\r\n    <div class="page-header">\r\n        <h1 compile="showController.title">\r\n            {{ showController.view.entity.name() | humanize:true | singularize }}  #{{ entry.identifierValue }} Detail\r\n        </h1>\r\n        <p class="lead" ng-if="showController.description">{{ showController.description }}</p>\r\n    </div>\r\n\r\n</div>\r\n\r\n\r\n<div class="row form-horizontal" id="show-view">\r\n\r\n    <div class="form-group" ng-repeat="field in showController.fields | orderElement track by $index">\r\n\r\n        <label class="col-sm-2 control-label">{{ field.label() }}</label>\r\n\r\n        <div class="show-value" ng-class="field.getCssClasses(entry)||\'col-sm-10 col-md-8 col-lg-7\'">\r\n\r\n            <ma-column field="::field" entry="::entry" entity="::entity"></ma-column>\r\n\r\n        </div>\r\n    </div>\r\n\r\n</div>\r\n';});


define('text!ng-admin/Crud/form/create.html',[],function () { return '<div class="row">\r\n\r\n    <ma-view-actions override="formController.actions" entry="entry" entity="formController.entity">\r\n        <ma-list-button entity="entity"></ma-list-button>\r\n    </ma-view-actions>\r\n\r\n    <div class="page-header">\r\n        <h1 compile="formController.title">\r\n            Create new {{ formController.view.entity.name() | humanize:true | singularize }}\r\n        </h1>\r\n        <p class="lead" ng-if="formController.description">{{ formController.description }}</p>\r\n    </div>\r\n\r\n</div>\r\n\r\n<div class="row" id="edit-container" ng-class="\'ng-admin-entity-\' + formController.entity.name()">\r\n    <form class="form-horizontal" name="{{ formController.name }}" ng-submit="formController.submitCreation(createForm, $event)">\r\n        <div class="form-field form-group" ng-include="\'ng-admin/Crud/form/edit-attribute.html\'" ng-repeat="field in formController.fields | orderElement track by $index"></div>\r\n\r\n        <div class="form-group">\r\n            <div class="col-sm-offset-2 col-sm-10">\r\n                <button type="submit" class="btn btn-primary"><span class="glyphicon glyphicon-ok"></span> Submit</button>\r\n            </div>\r\n        </div>\r\n    </form>\r\n</div>\r\n';});


define('text!ng-admin/Crud/form/edit.html',[],function () { return '<div class="row">\r\n\r\n    <ma-view-actions override="formController.actions" entry="entry" entity="formController.entity">\r\n        <ma-list-button entity="entity"></ma-list-button>\r\n        <ma-delete-button entry="entry" entity="entity"></ma-delete-button>\r\n    </ma-view-actions>\r\n\r\n    <div class="page-header">\r\n        <h1 compile="formController.title">\r\n            Edit {{ formController.entity.name() | humanize:true | singularize }}  #{{ entry.identifierValue }}\r\n        </h1>\r\n        <p class="lead" ng-if="formController.description">{{ formController.description }}</p>\r\n    </div>\r\n\r\n</div>\r\n\r\n<div class="row" id="edit-container" ng-class="\'ng-admin-entity-\' + formController.entity.name()">\r\n    <form class="form-horizontal" name="{{ formController.name }}" ng-submit="formController.submitEdition(editForm, $event)">\r\n        <div class="form-field form-group" ng-include="\'ng-admin/Crud/form/edit-attribute.html\'" ng-repeat="field in formController.fields | orderElement track by $index"></div>\r\n\r\n        <div class="form-group">\r\n            <div class="col-sm-offset-2 col-sm-10">\r\n                <button type="submit" class="btn btn-primary"><span class="glyphicon glyphicon-ok"></span> Save Changes</button>\r\n            </div>\r\n        </div>\r\n    </form>\r\n</div>\r\n';});


define('text!ng-admin/Crud/delete/delete.html',[],function () { return '<div class="row">\r\n\r\n    <ma-view-actions override="deleteController.actions" entry="entry" entity="deleteController.entity">\r\n        <ma-list-button entity="entity"></ma-list-button>\r\n    </ma-view-actions>\r\n\r\n    <div class="page-header">\r\n        <h1 compile="deleteController.title">\r\n            Delete {{ deleteController.view.entity.name() | humanize:true | singularize }}  #{{ entry.identifierValue }}\r\n        </h1>\r\n        <p class="lead" ng-if="deleteController.description">{{ deleteController.description }}</p>\r\n    </div>\r\n\r\n</div>\r\n\r\n<div class="row" id="edit-container">\r\n    <p>Are you sure ?</p>\r\n    <button class="btn btn-danger" ng-click="deleteController.deleteOne()">Yes</button>\r\n    <button class="btn btn-default" ng-click="deleteController.back()">No</button>\r\n</div>\r\n';});

/*global define*/

define('ng-admin/Crud/routing',['require','text!./list/list.html','text!./show/show.html','text!./form/create.html','text!./form/edit.html','text!./delete/delete.html'],function (require) {
    

    var listTemplate = require('text!./list/list.html'),
        showTemplate = require('text!./show/show.html'),
        createTemplate = require('text!./form/create.html'),
        editTemplate = require('text!./form/edit.html'),
        deleteTemplate = require('text!./delete/delete.html');

    function templateProvider(viewName, defaultView) {
        return ['$stateParams', 'NgAdminConfiguration', function ($stateParams, Configuration) {
            var customTemplate;
            var view = Configuration().getViewByEntityAndType($stateParams.entity, viewName);
            customTemplate = view.template();
            if (customTemplate) return customTemplate;
            customTemplate = Configuration().customTemplate()(viewName);
            if (customTemplate) return customTemplate;
            return defaultView;
        }];
    }

    function viewProvider(viewName) {
        return ['$stateParams', 'NgAdminConfiguration', function ($stateParams, Configuration) {
            var view = Configuration().getViewByEntityAndType($stateParams.entity, viewName);
            if (!view.isEnabled()) {
                throw new Error('The ' + viewName + ' is disabled for this entity');
            }
            return view;
        }];
    }

    function routing($stateProvider) {

        $stateProvider
            .state('list', {
                parent: 'main',
                url: '/list/:entity?{search:json}&page&sortField&sortDir',
                params: {
                    entity: null,
                    page: null,
                    search: null,
                    sortField: null,
                    sortDir: null
                },
                controller: 'ListController',
                controllerAs: 'listController',
                templateProvider: templateProvider('ListView', listTemplate),
                resolve: {
                    view: viewProvider('ListView'),
                    data: ['$stateParams', 'RetrieveQueries', 'view', function ($stateParams, RetrieveQueries, view) {
                        var page = $stateParams.page,
                            filters = $stateParams.search,
                            sortField = $stateParams.sortField,
                            sortDir = $stateParams.sortDir;

                        return RetrieveQueries.getAll(view, page, true, filters, sortField, sortDir);
                    }]
                }
            });

        $stateProvider
            .state('show', {
                parent: 'main',
                url: '/show/:entity/:id',
                controller: 'ShowController',
                controllerAs: 'showController',
                templateProvider: templateProvider('ShowView', showTemplate),
                params: {
                    entity: {},
                    id: null
                },
                resolve: {
                    view: viewProvider('ShowView'),
                    rawEntry: ['$stateParams', 'RetrieveQueries', 'view', function ($stateParams, RetrieveQueries, view) {
                        return RetrieveQueries.getOne(view, $stateParams.id);
                    }],
                    referencedValues: ['RetrieveQueries', 'view', 'rawEntry', function (RetrieveQueries, view, rawEntry) {
                        return RetrieveQueries.getReferencedValues(view, [rawEntry.values]);
                    }],
                    referencedListValues: ['$stateParams', 'RetrieveQueries', 'view', 'rawEntry', function ($stateParams, RetrieveQueries, view, rawEntry) {
                        var sortField = $stateParams.sortField,
                            sortDir = $stateParams.sortDir;

                        return RetrieveQueries.getReferencedListValues(view, sortField, sortDir, rawEntry.identifierValue);
                    }],
                    entry: ['RetrieveQueries', 'rawEntry', 'referencedValues', function(RetrieveQueries, rawEntry, referencedValues) {
                        return RetrieveQueries.fillReferencesValuesFromEntry(rawEntry, referencedValues, true);
                    }]
                }
            });

        $stateProvider
            .state('create', {
                parent: 'main',
                url: '/create/:entity',
                controller: 'FormController',
                controllerAs: 'formController',
                templateProvider: templateProvider('CreateView', createTemplate),
                resolve: {
                    view: viewProvider('CreateView'),
                    entry: ['view', function (view) {
                        var entry = view
                            .mapEntry({});

                        view.processFieldsDefaultValue(entry);

                        return entry;
                    }],
                    referencedValues: ['RetrieveQueries', 'view', function (RetrieveQueries, view) {
                        return RetrieveQueries.getReferencedValues(view);
                    }]
                }
            });

        $stateProvider
            .state('edit', {
                parent: 'main',
                url: '/edit/:entity/:id?sortField&sortDir',
                controller: 'FormController',
                controllerAs: 'formController',
                templateProvider: templateProvider('EditView', editTemplate),
                params: {
                    entity: {},
                    id: null,
                    sortField: null,
                    sortDir: null
                },
                resolve: {
                    view: viewProvider('EditView'),
                    entry: ['$stateParams', 'RetrieveQueries', 'view', function ($stateParams, RetrieveQueries, view) {
                        return RetrieveQueries.getOne(view, $stateParams.id);
                    }],
                    referencedValues: ['RetrieveQueries', 'view', 'entry', function (RetrieveQueries, view, entry) {
                        return RetrieveQueries.getReferencedValues(view, null);
                    }],
                    referencedListValues: ['$stateParams', 'RetrieveQueries', 'view', 'entry', function ($stateParams, RetrieveQueries, view, entry) {
                        var sortField = $stateParams.sortField,
                            sortDir = $stateParams.sortDir;

                        return RetrieveQueries.getReferencedListValues(view, sortField, sortDir, entry.identifierValue);
                    }]
                }
            });

        $stateProvider
            .state('delete', {
                parent: 'main',
                url: '/delete/:entity/:id',
                controller: 'DeleteController',
                controllerAs: 'deleteController',
                templateProvider: templateProvider('DeleteView', deleteTemplate),
                resolve: {
                    view: viewProvider('DeleteView'),
                    params: ['$stateParams', function ($stateParams) {
                        return $stateParams;
                    }],
                    entry: ['$stateParams', 'RetrieveQueries', 'view', function ($stateParams, RetrieveQueries, view) {
                        return RetrieveQueries.getOne(view, $stateParams.id);
                    }]
                }
            });

    }

    routing.$inject = ['$stateProvider'];

    return routing;
});

